from collections import defaultdict
from math import inf
from heapq import heappop, heappush
from functools import lru_cache
def countPaths(n, roads):

    graph = defaultdict(list)
    for u, v, w in roads: 
        graph[u].append((v, w))
        graph[v].append((u, w))
    distance = [inf]*n          # distance[i] = total distance 
    minHeap=[(0, 0)]
    distance[0] = 0
    parent = [-1]*n
    countWays = defaultdict(list)
    countWays[0]
    # print(countWays)

    while minHeap: 
        dist, u = heappop(minHeap)
        if u == n-1: 
            continue 
        if distance[u] != dist: continue 
        for v, w in graph[u]:
            if distance[v] > dist + w:
                countWays[v]=[u]
                distance[v] = dist + w
                heappush(minHeap, (dist + w, v))

            elif distance[v] == dist + w:
                countWays[v].append(u)    
    @lru_cache(None)
    # memo = {}

    def dfs(u):
        res = 0
        if u == 0: 
            res +=1
        else: 
            for v in countWays[u]:
                res += dfs(v)
        return res

    return dfs(n-1) % (10**9 + 7)

